import { useEffect, useState } from "react"

export default function Users(){
    const [users,setusers]=useState([])
    useEffect(()=>{
        fetch("http://127.0.0.1:8000/api/user/show")
        .then(res=>res.json())
        .then(data=>setusers(data))
    })
    const ShowUsers=users.map((user)=>
      <td>{user.name}</td>

        
    )
    return(
        <table >
            <thead>
                <th>Id</th>
                <th>Users</th>
                <th>Email</th>
            </thead>
            <tbody>
             <tr>
                <td>1</td>
             {ShowUsers}
                <td>123@gmail.com</td>
             </tr>
            </tbody>
        </table>
    )
}
